       values (
              '11',
              'Коньяк',
              '40',
              'Крепкий алкогольный напиток, получаемый перегонкой виноградного вина, либо фруктовой, либо ягодной браги. Если не уточняется, какой бренди, то речь идёт о виноградном бренди. Широко употребимый в странах СНГ термин \"Коньяк\" является зарегистрированной маркой, и экспортировать напитки под таким названием нельзя.');
insert into ` ingredients `
       values (
              '12',
              'Трипл сек',
              '30',
              'Трипл Сек (переводится как «тройной сухой») — это ликёр, который настаивается на сушёной кожуре апельсинов особого сорта, выращиваемых на островах Карибского бассейна. Этот напиток изобретён Жан-Батистом Комбером в 1837 году. Наиболее известные марки — Куантро и Оранжевый Кюрасао.');
insert into ` ingredients `
       values (
              '13',
              'Самбука',
              '42',
              'Самбука - это итальянский ликёр с анисовым ароматом. Изготавливается из пшеничного спирта, сахара, звёздчатого аниса, а также ароматических трав. Точный состав производитель самбуки - компания Молинари - держит в секрете. Выпускается несколько сортов данного ликёра.');
insert into ` ingredients `
       values (
              '14',
