insert into ` recipes `
       values (
              '2',
              'Голубая лагуна',
              'Приготовление напитка начинаем с добавления в шейкер водки, ликера, сока лимона и свежего льда. Закрываем плотно шейкер и тщательно перемешиваем содержимое в течение пары минут. После этого полученную смесь выливаем в подготовленный стакан, оставив при этом место, куда затем наливаем содовую воду или же лимонад. Если есть желание, коктейль можно украсить зонтиком, кусочком лимона или же добавить внутрь коктейльную вишенку.',
              0  , null , '1' );
insert into ` recipes `
       values (
