              0  , null , '1' );
insert into ` recipes `
       values (
              '4',
              'Сайдкар',
              'Края коктейльного бокала смочить лимонным соком и опустить в сахар для образования сладкой каёмки. В шейкере, заполненном льдом, смешать все ингридиенты. Перелить полученную смесь в подготовленный ранее бокал, украсить долькой лимона. Этот классический коктейль был изобретён в 1922 году.',
              0  , null , '2' );
insert into ` recipes `
       values (
